import React, { useEffect, useState } from 'react';
import axios from 'axios';

const InventorySummaryPage = () => {
  const [items, setItems] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');

  useEffect(() => {
    fetchInventory();
  }, []);

  const fetchInventory = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/inventory/all');
      setItems(res.data);
    } catch (err) {
      console.error('Error fetching inventory:', err);
    }
  };

  const groupByRack = () => {
    const grouped = {};

    items.forEach((item) => {
      const rackLetter = item.location?.[0]?.toUpperCase() || 'Unknown';
      if (!grouped[rackLetter]) {
        grouped[rackLetter] = [];
      }
      grouped[rackLetter].push(item);
    });

    return grouped;
  };

  const handleExport = () => {
    const headers = ['Item', 'Description', 'Location', 'Quantity'];
    const rows = items.map(i => [i.name, i.description || '', i.location, i.quantity]);
    const csvContent = [headers, ...rows].map(e => e.join(",")).join("\n");
    const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
    const url = URL.createObjectURL(blob);

    const link = document.createElement('a');
    link.href = url;
    link.setAttribute('download', 'inventory_summary.csv');
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  const groupedItems = groupByRack();

  const filteredGroupedItems = Object.fromEntries(
    Object.entries(groupedItems).map(([rack, items]) => [
      rack,
      items.filter(item =>
        item.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
        item.description?.toLowerCase().includes(searchQuery.toLowerCase()) ||
        item.location?.toLowerCase().includes(searchQuery.toLowerCase())
      )
    ]).filter(([_, rackItems]) => rackItems.length > 0)
  );

  return (
    <div style={styles.container}>
      <h2>ðŸ“¦ Inventory Summary by Rack</h2>

      <div style={styles.actionsRow}>
        <input
          type="text"
          placeholder="Search by item, description, or location"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          style={styles.searchInput}
        />
        <button onClick={handleExport} style={styles.exportBtn}>Export to CSV</button>
      </div>

      {Object.keys(filteredGroupedItems).sort().map((rack) => (
        <div key={rack} style={styles.rackSection}>
          <h3 style={styles.rackTitle}>Rack {rack}</h3>
          <table style={styles.table}>
            <thead>
              <tr>
                <th>Item</th>
                <th>Description</th>
                <th>Location</th>
                <th>Quantity</th>
              </tr>
            </thead>
            <tbody>
              {filteredGroupedItems[rack].map((item) => (
                <tr key={item._id} style={styles.tableRow}>
                  <td>{item.name}</td>
                  <td>{item.description || 'â€”'}</td>
                  <td>{item.location}</td>
                  <td>{item.quantity}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}
    </div>
  );
};

const styles = {
  container: {
    padding: '30px',
    fontFamily: 'Arial, sans-serif',
    background: 'linear-gradient(to right, #e0f7fa, #fdfdfd)',
    minHeight: '100vh'
  },
  actionsRow: {
    display: 'flex',
    justifyContent: 'space-between',
    marginBottom: '20px'
  },
  searchInput: {
    padding: '8px',
    fontSize: '14px',
    border: '1px solid #ccc',
    borderRadius: '6px',
    width: '60%'
  },
  exportBtn: {
    backgroundColor: '#007bff',
    color: '#fff',
    border: 'none',
    padding: '8px 16px',
    fontSize: '14px',
    borderRadius: '6px',
    cursor: 'pointer'
  },
  rackSection: {
    marginBottom: '40px',
    backgroundColor: '#fff',
    padding: '15px',
    borderRadius: '10px',
    boxShadow: '0 0 8px rgba(0,0,0,0.08)'
  },
  rackTitle: {
    marginBottom: '10px',
    color: '#333'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse'
  },
  tableRow: {
    borderBottom: '1px solid #ddd'
  }
};

export default InventorySummaryPage;
